import React from 'react';

const Slide = ({ image }) => {
    const styles = {
      backgroundImage: 'url('+ image +')',
      backgroundSize: 'cover',
      backgroundRepeat: 'no-repeat',
      display: 'grid',
      gridTemplateColumns: '45% 45%',
      width: '50%',
      height: '40%'
    }
     return <div className="slides" style={styles}></div>
   }

export default Slide;
